import styles from "./MeetupItem.module.css";

const MeetupItem = (props) => {
  return (
    <li className={styles.item}>
      <div>
        <img></img>
      </div>
      <div>
        <h3></h3>
      </div>
      <address></address>
      <button></button>
    </li>
  );
};

export default MeetupItem;
